import React, { Component } from 'react'
import {Link} from "react-router-dom"
import Heading from "../../../components/heading/Heading"
export default class Login extends Component {
  constructor(props){
    super(props);
    this.state={
      email:"",
      password:"",
      error:""
    }

  }
    render() {
        return (
            <div>
                    <div className="content_rgt">
              <div className="login_sec">
                <form>
                <ul>
                  <li><span>Email-ID</span><input type="text" placeholder="Enter your email" required/></li>
                  <li><span>Password</span><input type="text" placeholder="Enter your password" required/></li>
                  <li><input type="checkbox" required/>Remember Me</li>
                  <li><input type="submit" defaultValue="Log In" /><a href>Forgot Password</a></li>
                </ul>
                </form>
                <div className="addtnal_acnt">I do not have any account yet.<a href><Link to="/">Create My Account Now !</Link></a></div>
              </div>
            </div>
            </div>
        )
    }
}
